        CallRequest {
            hash: 0,
            caller_contract_address: AztecAddress::zero(),
            caller_context: CallerContext::empty(),
            start_side_effect_counter: 0,
            end_side_effect_counter: 0,
        }
    }
}

impl CallRequest {
    pub fn is_empty(self) -> bool {
        self.hash == 0
    }
}

